    { title: "Car Insurance", price: "$209.18", date: new Date(2021, 2, 28) },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem />
      <ExpenseItem />
    </div>
  );
}

export default App;
